import React from 'react';
import Sticky from 'react-sticky-el';
import ProfileIcon from '../ProfileIcon';

const SideBar = () => {
    return (
        <Sticky topOffset={-80}>
            <div className="sideBar">
                {/*  profile */}
                <div className="profile">
                    <ProfileIcon iconSize="big" />
                </div>
            </div>


        </Sticky>
    )
};


export default SideBar;
